import Card from "../card/Card";
import CardBody from "../card/CardBody";

export default function Rankings({p}) {


    return (
        <div>
            <Card
                p={p}
                title="Rankings">
                <CardBody>
                    <p>HI</p>
                </CardBody>
            </Card>
        </div>
    )
}
